const Graph = ({...node}) => {
    if (!node) {
        return (
            <div>
                <p>Identity: {}</p>
                <p>Labels: {}</p>
                <p>Name: {}</p>
                <p>Import Id: {}</p>
            </div>
        )

    } else {
        return (
        <div>
            <p>{node.identity}</p>
            <p>{node.labels}</p>
            <p>{node.properties.name}</p>
            <p>{node.properties.neo4jImportId}</p>
        </div>)
    }


}

export default Graph
